// App.tsx
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createDrawerNavigator } from '@react-navigation/drawer';
import LoginScreen from './components/Login'; // Ensure path is correct
import Register from './components/Register'; // Ensure path is correct
import Home from './components/Home';
import Search from './components/Search';
import ProdInfo from './components/ProdInfo';
// import UserInf from './components/UserInf'; // Corrected typo in file name
import  AuthProvider  from './components/AuthService';

type RootDrawerParamList = {
  Home: undefined;
  User: undefined;
  Login: undefined;
  Register: undefined;
  Search: undefined;
  ProdInfo: undefined;
};

const Drawer = createDrawerNavigator<RootDrawerParamList>();

const App: React.FC = () => {
  return (
    <NavigationContainer>
      <AuthProvider>
        <Drawer.Navigator initialRouteName="Home">
          <Drawer.Screen name="Home" component={Home} />
          {/* <Drawer.Screen name="User" component={UserInf} /> */}
          <Drawer.Screen name="Login" component={LoginScreen} />
          <Drawer.Screen name="Register" component={Register} />
          <Drawer.Screen name="Search" component={Search} />
          <Drawer.Screen name="ProdInfo" component={ProdInfo} />
        </Drawer.Navigator>
      </AuthProvider>
    </NavigationContainer>
  );
};

export default App;
